import React from 'react';
import ReactDOM from 'react-dom';
import App from './components/App.js'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './index.css';

ReactDOM.render(
    <React.StrictMode>
      <Router>
        <h1>Test</h1>
        <App />
      </Router>
    </React.StrictMode>,
  document.getElementById('root')
);
